import React from 'react';
import styled from 'styled-components';
import {TITLE} from './ProductComponent/products';

class Company extends React.Component {
  render() {
    return(
      <React.StrictMode>
        <TITLE>Company</TITLE>
      <Infomation>
        <dt>社名</dt>
        <dd>株式会社ファニチャーデザイン</dd>
        <dt>住所</dt>
        <dd>〒107-0062 東京都港区南青山１丁目××××××</dd>
        <dt>設立</dt>
        <dd>XXXX年XX月</dd>
        <dt>資本金</dt>
        <dd>XXXX万円</dd>
        <dt>従業員数</dt>
        <dd>XX名</dd>
        <dt>事業内容</dt>
        <dd>
          <ul>
            <li>家具、インテリアの企画・生産</li>
            <li>家具、インテリアの販売</li>
            <li>店舗の企画・デザイン・設計</li>
          </ul>
        </dd>
      </Infomation>
      <Map></Map>
      </React.StrictMode>
    );
  }
}

const Infomation = styled.dl`
  display: flex;
  flex-wrap: wrap;
  width: 600px;
  color: #333;
  dt {
    width: 30%;
    border-bottom: solid 1px #dcdbdb;
    padding: 20px 10px;
  }

  dd {
    width: 70%;
    border-bottom: solid 1px #dcdbdb;
    padding: 20px 10px;
  }

  dt:nth-of-type(6)  {
    border-bottom: none;
  }

  dd:nth-of-type(6)  {
    border-bottom: none;
  }
`;

const Map = styled.div`
  width: 600px;
  height: 305px;
`;

export default Company;
